import React from "react";
import { Link } from "react-router-dom";
import './header.css';

function Header(props) {
  const {dashboardHeader} = props;
  return (
      <header>
        <nav>
          <ul>
            <ul className="menuul">
              {{

                if (dashboardHeader)
                {
                 dashboardHeader.map((item)=> {
                   return (<li><Link to={item.link}>{item.text}</Link></li>)
                 })
                }

              }}


            </ul>
          </ul>
        </nav>

                 </header>
    );
}
  export default Header;
